import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state = {
    countdown: [
      {
        "days": "23",
        "hours": 13,
        "minutes": 20,
        "seconds": 34
      }
    ]
  }
  render() {
    const { countdwn } = this.state.countdown;
    return (
      <div className="App" >
        <div className="intro-text">
          <p>When is CSN due?</p>
          <hr />
        </div>
        <div className="timer">

          <p> {countdwn.days} Days 13 Hours 20 Minutes 34 Seconds</p>
        </div>
        <div className="qoute-of-the-day">
          <p className="quote">"You only remeber the things you didn't do... maybe</p>
          <p className="quoter">-Vendela Viklund</p>
        </div>
        <a className="link-csn" href="https://www.csn.se/" target="_blank">Click here to visit CSNs website</a>
      </div>
    );
  }
}

export default App;
